import React from 'react';
import { Container, Row, Col,Jumbotron } from 'react-bootstrap';

function Thankyou(props){

    return(
        <div>
            
            <Jumbotron className="text-center">
                <h1>Thank You</h1>
                
            </Jumbotron>
            
            
        </div>
    )
}
export default Thankyou;
